import React, { Component } from 'react'

class MapField extends Component {

  constructor(props) {
    super(props);
    this.state = "";
  }

  initMap = () => {
    let mMap = new google.maps.Map(document.getElementById('map'), {
      center: {
        lat: 50.121870,
        lng: 8.689550
      },
      zoom: 13
    });
  };

  render() {
    return <div className="map">
      <script async defer
        src={`https://maps.googleapis.com/maps/api/js?key=AIzaSyB8uwCpGazZQ4JvdwNQP9Jt0GH0FukWd-M&callback=${this.initMap}`}/>
    </div>
  }

}

export default MapField;
